import React from "react";
import "../styles/Card.css";

function Card({ src, title, description, price }) {
  return (
    <div className="card">
      <img data-testid="img-test"  src={src} alt="" />

      <div className="card_info">
        <h2 data-testid="h1-test" >{title}</h2>
        <h4>{description}</h4>
        <h3>{price}</h3>
      </div>
    </div>
  );
}

export default Card;
